import{_ as e,c as t,o as a,a as s}from"./app.aecb249e.js";const r="/assets/expression.59c8b971.png",o="/assets/format-column.c188092b.png",y=JSON.parse('{"title":"Dimension and Metrics","description":"","frontmatter":{},"headers":[{"level":2,"title":"Expressions","slug":"expressions"},{"level":2,"title":"Formatting","slug":"formatting"},{"level":3,"title":"Date and Time","slug":"date-and-time"},{"level":3,"title":"Number","slug":"number"}],"relativePath":"query/dimension-metrics.md","lastUpdated":1681986768000}'),n={name:"query/dimension-metrics.md"},i=s('<h1 id="dimension-and-metrics" tabindex="-1">Dimension and Metrics <a class="header-anchor" href="#dimension-and-metrics" aria-hidden="true">#</a></h1><p>Dimensions and metrics are the building blocks of your query. Dimensions are the attributes of your data, and metrics are the measurements of those attributes. Dimensions and metrics are used to create visualizations and dashboards.</p><p>Dimensions are used to group your data. For example, if you have a table of sales data, you can group your data by product category to see how much revenue each category is generating.</p><p>Metrics are used to measure your data. For example, if you have a table of sales data, you can measure the total revenue generated by each product category.</p><p>In this case, the product category is a dimension and revenue is a metric.</p><h2 id="expressions" tabindex="-1">Expressions <a class="header-anchor" href="#expressions" aria-hidden="true">#</a></h2><p>You can use expressions to create new metrics from existing metrics or to create new dimensions from existing dimensions. For example, you can create a new metric that calculates the percentage of revenue generated by each product category.</p><p>To write an expression, switch to the <strong>Expressions</strong> tab in the Dimensions &amp; Metrics section.</p><div class="border rounded flex items-center justify-center bg-gray-50 w-full py-8"><img class="shadow rounded-sm" src="'+r+'" alt="Joins" width="30%"></div><div class="tip custom-block"><p class="custom-block-title">Expression Help</p><p>You can start typing a method or function name to see a list of available options. You can also use the autocomplete feature to see an example of how to use the method or function.</p></div><p>You can see the available functions and operators in the <a href="./expressions.html">Expressions</a> section.</p><h2 id="formatting" tabindex="-1">Formatting <a class="header-anchor" href="#formatting" aria-hidden="true">#</a></h2><p>You can format your dimensions and metrics to change the way they are displayed in your visualizations. For example, you can format a metric to display a percentage or a currency.</p><p>To format a dimension or metric, click the <strong>Format</strong> button next to the dimension or metric.</p><div class="border rounded flex items-center justify-center bg-gray-50 w-full py-8"><img class="shadow rounded-sm" src="'+o+'" alt="Joins" width="30%"></div><h3 id="date-and-time" tabindex="-1">Date and Time <a class="header-anchor" href="#date-and-time" aria-hidden="true">#</a></h3><p>You can format date and time dimensions to display the date and time in a specific format. For example, you can format a date dimension to display the date as <strong>January 1, 2020</strong>.</p><p>Following are the available date and time formats:</p><ul><li><strong>January 12, 2020 1:14 PM</strong></li><li><strong>January 12, 2020 1:00 PM</strong></li><li><strong>January 12, 2020</strong></li><li><strong>January, 2020</strong></li><li><strong>Q1, 2020</strong></li><li><strong>2020</strong></li><li><strong>Jan 20</strong></li><li><strong>1:00 PM</strong></li><li><strong>Monday</strong></li><li><strong>January</strong></li><li><strong>Q1</strong></li></ul><h3 id="number" tabindex="-1">Number <a class="header-anchor" href="#number" aria-hidden="true">#</a></h3><p>You can add a prefix or suffix to a number dimension or metric. For example, you can add a <strong>$</strong> prefix to a metric to display the metric as <strong>$100</strong>.</p>',21),d=[i];function c(l,m,u,p,h,g){return a(),t("div",null,d)}const x=e(n,[["render",c]]);export{y as __pageData,x as default};
